import React from "react";
import Amazon from "./Amazon.jsx";
import Netflix from "./Netflix.jsx";

const favseries = "Netflix";

const Ncards = () =>{
    if (favseries === "Amazon"){

        return <Netflix/>
    }else{
        return <Amazon/>
    }
}

 const App =() =>{
     return(
         <>
       
            <Ncards/>
         </>
     );
    
 }

 export default App
